import Gallerycard from './components/gallery';
import './App.css';
import one from './components/assets/images/1.jpg';
import two from './components/assets/images/2.jpg';
import './index.css'

const GalleryData = [
  {
    image: one,
    title: "Black cover",
  }
  ,
  {
    image: two,
    title: "Attack on Titan",
  }
];
function App() {
  return (
    <div className='gallery'>
        <h1 style={{margin:"0px", marginBottom:"50px", padding:"0px"}}>Anime Gallery</h1>
        <div style={{display:"flex", flexWrap:"wrap", justifyContent:"space-around"}}>
      {
        GalleryData.map((gallery)=>{
          const {image, title} = gallery;
          return (
            <Gallerycard image={image} title={title} />
          )
        })
      }
      </div>
    </div>
  );
}

export default App;
